import React,{Component} from 'react';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css';


class If_Else extends Component{
    constructor(){
        super()
        this.state={
            login: true,
            logout: false
        }
    }
        
    render(){
         if(this.state.logout == true){
                return (<button className="btn btn-primary m-5">Log Out</button>);
         }else{
            return (<button className="btn btn-danger m-5">Log in Now</button>);
         }
    }
}
export default If_Else;
